import data from "../../data/index.json";
import css from "../../../sr"; // Make sure to define rotation in CSS=

export default function TechStack() {
  return (
    <section className="skills--section" id="techStack">
      <div className="portfolio--container">
        <p className="section--title">Tech Stack</p>
        <h2 className="skills--section--heading">Technologies I Work With</h2>
      </div>
      <div className="techstack--logo--carousel">
        {data?.skills?.map((item, index) => (
          <div key={index} className="techstack--logo--item">
            <img src={item.src} alt={item.title} />
          </div>
        ))}
      </div>
    </section>
  );
}
